--
-- Estrutura tabela 'uf'
--
CREATE TABLE uf (
    cod_uf INT(1) NOT NULL,
    nome VARCHAR(32) NOT NULL,
    CONSTRAINT pk_uf
        PRIMARY KEY (cod_uf)
);
--
-- Estrutura tabela 'mesorregiao'
--
CREATE TABLE mesorregiao (
    cod_uf INT(1) NOT NULL,
    cod_mesorregiao INT(2) NOT NULL,
    nome VARCHAR(64) NOT NULL,
    CONSTRAINT pk_mesorregiao
        PRIMARY KEY (cod_uf, cod_mesorregiao),
    CONSTRAINT fk_messoregiao_uf
        FOREIGN KEY (cod_uf)
            REFERENCES uf (cod_uf)
            ON DELETE RESTRICT 
            ON UPDATE CASCADE
);
--
-- Estrutura tabela 'microrregiao'
--
CREATE TABLE microrregiao (
    cod_uf INT(1) NOT NULL,
    cod_mesorregiao INT(2) NOT NULL,
    cod_microrregiao INT(3) NOT NULL,
    nome VARCHAR(64) NOT NULL,
    CONSTRAINT pk_microrregiao
        PRIMARY KEY (cod_uf, cod_mesorregiao, cod_microrregiao),
    CONSTRAINT fk_microregiao_uf
        FOREIGN KEY (cod_uf)
            REFERENCES uf (cod_uf)
            ON DELETE RESTRICT
            ON UPDATE CASCADE,
    CONSTRAINT fk_microrregiao_mesorregiao
        FOREIGN KEY (cod_uf, cod_mesorregiao)
            REFERENCES mesorregiao (cod_uf, cod_mesorregiao)
            ON DELETE RESTRICT
            ON UPDATE CASCADE
);
--
-- Estrutura tabela 'municipio'
--
CREATE TABLE municipio (
    cod_uf INT(1) NOT NULL,
    cod_mesorregiao INT(2) NOT NULL,
    cod_microrregiao INT(3) NOT NULL,
    cod_municipio INT(3) NOT NULL,
    nome VARCHAR(64) NOT NULL,
    CONSTRAINT pk_municipio
        PRIMARY KEY (cod_uf, cod_mesorregiao, cod_microrregiao, cod_municipio),
    CONSTRAINT fk_municipio_uf
        FOREIGN KEY (cod_uf)
            REFERENCES uf (cod_uf)
            ON DELETE RESTRICT
            ON UPDATE CASCADE,
    CONSTRAINT fk_municipio_mesorregiao
        FOREIGN KEY (cod_uf, cod_mesorregiao)
            REFERENCES mesorregiao (cod_uf, cod_mesorregiao)
            ON DELETE RESTRICT
            ON UPDATE CASCADE,
    CONSTRAINT fk_municipio_microrregiao
        FOREIGN KEY (cod_uf, cod_mesorregiao, cod_microrregiao)
            REFERENCES microrregiao (cod_uf, cod_mesorregiao, cod_microrregiao)
            ON DELETE RESTRICT
            ON UPDATE CASCADE
);
--
-- Estrutura tabela 'distrito'
--
CREATE TABLE distrito (
    cod_uf INT(1) NOT NULL,
    cod_mesorregiao INT(2) NOT NULL,
    cod_microrregiao INT(3) NOT NULL,
    cod_municipio INT(3) NOT NULL,
    cod_distrito INT(1) NOT NULL,
    nome VARCHAR(64) NOT NULL,
    CONSTRAINT pk_distrito
        PRIMARY KEY (cod_uf, cod_mesorregiao, cod_microrregiao, cod_municipio, cod_distrito),
    CONSTRAINT fk_distrito_uf
        FOREIGN KEY (cod_uf)
            REFERENCES uf (cod_uf)
            ON DELETE RESTRICT
            ON UPDATE CASCADE,
    CONSTRAINT fk_distrito_mesorregiao
        FOREIGN KEY (cod_uf, cod_mesorregiao)
            REFERENCES mesorregiao (cod_uf, cod_mesorregiao)
            ON DELETE RESTRICT
            ON UPDATE CASCADE,
    CONSTRAINT fk_distrito_microrregiao
        FOREIGN KEY (cod_uf, cod_mesorregiao, cod_microrregiao)
            REFERENCES microrregiao (cod_uf, cod_mesorregiao, cod_microrregiao)
                ON DELETE RESTRICT
                ON UPDATE CASCADE,
    CONSTRAINT fk_distrito_municipio
        FOREIGN KEY (cod_uf, cod_mesorregiao, cod_microrregiao, cod_municipio)
            REFERENCES municipio (cod_uf, cod_mesorregiao, cod_microrregiao, cod_municipio)
                ON DELETE RESTRICT
                ON UPDATE CASCADE
);
--
-- Estrutura tabela 'subdistrito'
--
CREATE TABLE subdistrito (
    cod_uf INT(1) NOT NULL,
    cod_mesorregiao INT(2) NOT NULL,
    cod_microrregiao INT(3) NOT NULL,
    cod_municipio INT(3) NOT NULL,
    cod_distrito INT(1) NOT NULL,
    cod_subdistrito INT(1) NOT NULL,
    nome VARCHAR(64) NOT NULL,
    CONSTRAINT pk_subdistrito
        PRIMARY KEY (cod_uf, cod_mesorregiao, cod_microrregiao, cod_municipio, cod_distrito, cod_subdistrito),
    CONSTRAINT fk_subdistrito_uf
        FOREIGN KEY (cod_uf)
            REFERENCES uf (cod_uf)
            ON DELETE RESTRICT
            ON UPDATE CASCADE,
    CONSTRAINT fk_subdistrito_mesorregiao
        FOREIGN KEY (cod_uf, cod_mesorregiao)
            REFERENCES mesorregiao (cod_uf, cod_mesorregiao)
            ON DELETE RESTRICT
            ON UPDATE CASCADE,
    CONSTRAINT fk_subdistrito_microrregiao
        FOREIGN KEY (cod_uf, cod_mesorregiao, cod_microrregiao)
            REFERENCES microrregiao (cod_uf, cod_mesorregiao, cod_microrregiao)
            ON DELETE RESTRICT
            ON UPDATE CASCADE,
    CONSTRAINT fk_subdistrito_municipio
        FOREIGN KEY (cod_uf, cod_mesorregiao, cod_microrregiao, cod_municipio)
            REFERENCES municipio (cod_uf, cod_mesorregiao, cod_microrregiao, cod_municipio)
            ON DELETE RESTRICT
            ON UPDATE CASCADE,
    CONSTRAINT fk_subdistrito_distrito
        FOREIGN KEY (cod_uf, cod_mesorregiao, cod_microrregiao, cod_municipio, cod_distrito)
            REFERENCES distrito (cod_uf, cod_mesorregiao, cod_microrregiao, cod_municipio, cod_distrito)
            ON DELETE RESTRICT
            ON UPDATE CASCADE
);
